import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap-icons/font/bootstrap-icons.css'; // For icons (optional)

function NavScrollExample() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary fixed-top">
      <Container fluid>
        <Navbar.Brand href="#">ProjectManager Pro</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="#dashboard">Dashboard</Nav.Link>
            <Nav.Link href="#tasks">Tasks</Nav.Link>
            <NavDropdown title="Projects" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#create-project">Create Project</NavDropdown.Item>
              <NavDropdown.Item href="#manage-projects">
                Manage Projects
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#archived-projects">
                My Projects
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="#reports">Reports</Nav.Link>
          </Nav>
          <div className="d-flex">
            <Button variant="outline-primary" className="me-2">Sign In</Button>
            <Button variant="primary">Sign Up</Button>
          </div>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
